import React from 'react'

function Joke(props){
    if (props.question === null){
        const a = "no question"

    }
    return(
        <div>
            <p>Question: {props.question}| this.a</p>
            <p>Punchline: {props.punchline}</p>
        </div>
    )
}
export default Joke;
